@Injectable({
  providedIn: 'root'
})
export class SearchService {
  #searchedGenreNames: any[];
  constructor() {
    this.#searchedGenreNames = [];
  }
  set setSearchedGenreNames(genreNames: any[]) {
    this.#searchedGenreNames = genreNames;
  }
  get getSearchedGenreNames(): any[] {
    return this.#searchedGenreNames;
  }
}
